(def test-obs "bbbbbbbbabbabbaaabbaaabbabbaaaaaabbaaabbabbaaabbbbbbabbaaabbbbbbbbbbabbbbbbbbbbabbaabbabbbbabbbbaaaaaaaaabbabbabbaaaabbabbaaaaabbaabbabbbbabbbbbbaabbabbabbbbabbabbbbbbaaabbabbbbaaabbbbaaabbbbbbabbaaaa")
(def is-states (take num-particles (infer :importance pdfa [test-obs alphabet])))
